import React from 'react';
import { Row, Col } from 'react-bootstrap';


function Resume() {
    return (
        <section>
            <div>
                <h2>Resume</h2>
            </div>
            <div>
                <Row>
                    <Col>
                    <h4>Website and Social Media Manager</h4>
                    <p>2019 - current</p>
                    </Col>
                    <Col></Col>
                </Row>
            </div>
        </section>
    )
}

export default Resume;
